    const navigate = useNavigate()
    function handleYes(){
        navigate("/login")
    }
    function handleNo(){
        navigate("/")
    }
     swal({
        title:"Are you sure you want to log out?",
        text:"You will be redirected to login",
        Icon:"warning",
        buttons:true,
        dangerMode:true,
     })
     .then((willDelete)=>{
        if(willDelete){
            swal("You have logged out!",{
                icon:"success",
            })
            setIsLoggedIn(false);
        }else{
            swal("Back To Love For You!",{
                icon:"warning",
            })
            navigate("/main")
        }
     })
  return (
